import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/nav1.js'; // Assuming Navbar is a shared component
import Footer from './components/footer.js'; // Assuming Footer is a shared component
import HomePage from './pages/homepage.js';
import BagPage from './pages/BagPage.js'; // Placeholder for actual component
import TeamPage from './pages/ourteame.js'; // Placeholder for actual component

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/bag" element={<BagPage />} />
        <Route path="/team" element={<TeamPage />} />
        {/* Define other routes here */}
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
